@XboxPope Dorian gave South Florida a scare. Gas stations ran out of gas and there was no water to be found....

But thank god, Dorian never had a direct  hit on South Florida. All we had was light rain from the storm.

But everything is back to normal.

@GeorgeMgoblue07 Yep. Just getting some wind and rain. Typical South Florida day.

Blasting rock and roll as usual.  And got me weed capsules. 

Thanks for asking.
